       (4, 4, '2023-7-14T10:30:00+00:00', 4, 4,
        'This house provides an amazing living experience. The interior of the house is cozy and comfortable, and the amenities are top-notch. We particularly enjoyed the spacious living room with a fireplace, where we could relax and enjoy the warm atmosphere on chilly evenings. The kitchen is also well-equipped, making cooking a pleasant experience. Overall, we were very satisfied with our stay in this house.n'),
       (5, 5, '2023-7-14T10:30:00+00:00', 5, 5,
        'Our experience in this house was absolutely fantastic! From the moment we arrived, we were impressed by the beautiful surroundings and the impeccable cleanliness of the house. The bedrooms are spacious and tastefully decorated, and the outdoor area is perfect for enjoying the sunshine. We also appreciated the thoughtful touches throughout the house, such as complimentary toiletries and a welcome basket. Without a doubt, this is one of the best houses we''ve ever stayed in.'),
       (6, 4, '2023-7-14T10:30:00+00:00', 6, 6,
        'Our experience in this house was pleasant overall. The location is convenient, and the house itself is cozy and well-maintained. However, we did encounter a few minor issues during our stay, such as a leaking faucet in the bathroom and some outdated appliances in the kitchen. Despite these small inconveniences, we still enjoyed our time here and would consider staying again in the future.'),
       (7, 3, '2023-7-14T10:30:00+00:00', 7, 7,
        'We had an absolutely wonderful time in this house! The property is simply stunning, with breathtaking views of the surrounding landscape. Inside, the house is beautifully decorated and furnished to a very high standard. We particularly appreciated the spacious bedrooms and luxurious bathrooms. The outdoor pool area is also fantastic, perfect for relaxing in the sunshine. Overall, we couldn''t have asked for a better place to stay.'),
